def process_beach_data(file_path):
    # Read the CSV file
    df = pd.read_csv(file_path)

    # Get the beach name from the file name
    beach_name = os.path.basename(file_path).replace('_datasheet.csv', '')

    # Find the row containing 'Date' and use it as header
    date_row_idx = None
    for idx, row in df.iterrows():
        if 'Date' in row.values:
            date_row_idx = idx
            break

    if date_row_idx is not None:
        # Get the header row
        header = df.iloc[date_row_idx]
        # Create new column names
        new_columns = []
        for i in range(len(df.columns)):
            if pd.notna(header.iloc[i]):
                new_columns.append(str(header.iloc[i]))
            else:
                new_columns.append(df.columns[i])
        df.columns = new_columns
        # Get data after header row
        df = df.iloc[date_row_idx + 1:].reset_index(drop=True)

    # Convert rain data to float, handling potential string values
    rain_cols = ['1-Day Rain', '2-Day Rain', '3-Day Rain']
    for col in rain_cols:
        if col in df.columns:
            df[col] = pd.to_numeric(df[col].astype(str), errors='coerce')

    # Get all Enterococcus columns (some beaches have multiple sampling locations)
    enterococcus_cols = [col for col in df.columns if 'Enterococcus' in str(col)]

    # Convert Enterococcus values to numeric, handling '<' symbols and other non-numeric values
    for col in enterococcus_cols:
        if col in df.columns:
            # Convert to string first to handle any non-string values
            series = df[col].astype(str)
            # Remove '<' symbols
            series = series.replace('<', '', regex=False)
            # Convert to numeric
            df[col] = pd.to_numeric(series, errors='coerce')

    return df, enterococcus_cols, beach_name

def count_failures(df, enterococcus_cols):
    # Filter for no rain in preceding 3 days
    try:
        no_rain = df[
            (pd.to_numeric(df['1-Day Rain'], errors='coerce') == 0) & 
            (pd.to_numeric(df['2-Day Rain'], errors='coerce') == 0) & 
            (pd.to_numeric(df['3-Day Rain'], errors='coerce') == 0)
        ]
    except KeyError:
        print(f"Warning: Missing rain columns in dataframe")
        return 0, 0

    # Count samples that failed the standard across all sampling locations
    total_failures = 0
    total_samples = 0

    for col in enterococcus_cols:
        if col in df.columns:
            samples = no_rain[col].dropna()
            failures = (samples >= 104).sum()
            # Convert numpy types to Python native types
            total_failures += int(failures)
            total_samples += int(len(samples))

    return total_failures, total_samples

